const Peopleinfo = ({ name, model, vehicle_class, passengers }) => {
    return (
        <div className="tc bg-light-green dib br3 ma2 grow bw2 shadow-5 pa4">
            <h5>{name}</h5>
            <p>{model}</p>
            <p>{vehicle_class}</p>
            <p>{passengers}</p>
        </div>  
    );
}

export default Vehicle;
